import React from 'react';
import Mercadobitcoin from '../component/mercadobitcoin.jsx';
import UsaExchange from '../component/usaexchange.jsx';
import Bitcambio from '../component/bitcambio.jsx';
import Braziliex from '../component/braziliex.jsx';
import Negociecoins from '../component/negociecoins.jsx';
import EuroExchange from '../component/euroexchange.jsx';
import BasicMap from "../component/tooltip.jsx";
import '../../styles/cryptomap.css';

export class Cryptomap extends React.Component{
  render(){
    return(
        <div className="container-fluid pic5">
            <BasicMap />
            <div className="card-group">
                <h1 className="col-12">Compare here:</h1>
                <div className="card">
                    <img alt=" United States National Flag" style = {{width: 382, height: 180}} className="card-img-top" src="https://media.istockphoto.com/photos/close-up-waving-american-flag-picture-id598537146?k=6&m=598537146&s=612x612&w=0&h=XOkykyV8DooLzq_rgC4mNNVgmO5zQGvs-dUSO7zBK6k=" alt="Card image cap"/>
                    <div className="card-body">
                        <h4 className="card-title">United States</h4>
                        <h6 className="card-text"><UsaExchange/></h6>
                        <p className="card-text"><small className="text-muted">Last updated price</small></p>
                    </div>
                </div>
                <div className="card">
                    <img  alt="Brazil national flag" style = {{width: 382, height: 180}} className="card-img-top" src="data:image/jpeg;base64," alt="Card image cap"/>
                    <div className="card-body">
                        <h4 className="card-title">Brazil</h4>
                        <h6 className="card-text"><Mercadobitcoin/><Negociecoins/><Bitcambio/><Braziliex/></h6>
                        <p className="card-text"><small className="text-muted">Last price updated</small></p>
                    </div>
                </div>
                <div className="card">
                    <img alt="European Union Flag" style = {{width: 382, height: 180}} className="card-img-top" src="data:image/png;base64," alt="Card image cap"/>
                    <div className="card-body">
                        <h5 className="card-title">Europe</h5>
                        <p className="card-text"><EuroExchange/></p>
                        <p className="card-text"><small className="text-muted">Last price updated</small></p>
                    </div>
                </div>
            </div>
        </div>
      );
  }
}

export default Cryptomap;
